import React from "react";
import { Link } from "react-router-dom";

const EventsHead = () => {
  return (
      <div>
      <section className="mb-0 top">
          <div className="container dark">
              <h2 className="page-section-heading2 text-center">UPCOMING EVENTS</h2>
          </div>
      </section>
    </div>
  );
};

export default EventsHead;
